import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    appBar: {
        borderRadius: 10,
        margin: '20px 0',
        display: 'fles',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '10px',
    },
    container: {
        display: 'flex',
        alignItems: 'center',
    },

    
})) ;
